p_a='<div class="aI"><div id="ID-page"></div></div>',q_a='<div class="aT">',r_a='<div class="abb">',s_a='<div class="account_label_1 no fD" title="',t_a='<div class="account_label_all no"><div class="O0">Alle konti</div></div>',u_a='<div class="ad ad-_',v_a='<div class="ad ad-_plus_one">',Nf='<div class="af">',w_a='<div class="afb"><div class="F2"><div id="ID-',x_a='<div class="ah"><div class="Tj"><h2 class="ei">Den sociale relation</h2><p>Det sociale net forbinder personer de steder, de deler, kritiserer og interagerer med indhold og med hinanden. Analytics Sociale medier giver dig v\u00e6rkt\u00f8jerne til at m\u00e5le effekten af social aktivitet. Du kan identificere meget v\u00e6rdifulde netv\u00e6rk og meget v\u00e6rdifuldt indhold, spore brugernes interaktion med dit indhold b\u00e5de p\u00e5 og uden for websitet og forbinde det hele med indtjeningen p\u00e5 bundlinjen via m\u00e5l og konverteringer.</p><p>Her er vores syn p\u00e5 sagen:</p><p><b>Kilder og sager:</b> Identificer netv\u00e6rk og f\u00e6llesskaber, hvor brugerne engagerer sig i dit indhold.</p><p><b>Konverteringer:</b> M\u00e5l v\u00e6rdien af social aktivitet ved at spore dine m\u00e5l, konverteringer og e-handelstransaktioner.</p><p><b>Sociale plugins:</b> M\u00e5l brugernes engagement p\u00e5 dit website.</p><p><b>Str\u00f8m af sociale bes\u00f8gende:</b> Sammenlign trafikm\u00e6ngden og de bes\u00f8gendes trafikm\u00f8nstre p\u00e5 dit website.</p></div></div>',
y_a='<div class="ah"><div class="Tj"><h2 class="ei">Find ud af, hvor din sociale trafik stammer fra</h2><p>Identificer de netv\u00e6rk og f\u00e6llesskaber, hvor personer engagerer sig i dit indhold. F\u00e5 flere oplysninger om hvert enkelt f\u00e6llesskab, og identificer dit mest effektive indhold i hvert netv\u00e6rk.</p></div></div>',z_a='<div class="ah"><div class="Tj"><h2 class="ei">F\u00e5 indsigt i din aktivitet uden for websitet</h2><p>Folk engagerer sig i, deler og diskuterer dit indhold p\u00e5 andre websites end dit eget. Se delingsaktivitet p\u00e5 <a href="http://code.google.com/apis/analytics/docs/socialData/home.html" target="_blank">partnernetv\u00e6rk for knudepunkt for sociale data</a> direkte i disse rapporter.</p></div></div>',
A_a='<div class="ah"><div class="Tj"><h2 class="ei">M\u00e5l dit engagement p\u00e5 dit website</h2><p>Find ud af, hvilke sociale knapper bes\u00f8gende klikker p\u00e5, og hvilke sider de deler og synes godt om. <a href="http://support.google.com/analytics/bin/answer.py?answer=1316556" target="_blank">F\u00e5 flere oplysninger om analyse af sociale plugins.</a></p></div></div>',B_a='<div class="ah"><div class="Tj"><h2 class="ei">M\u00e5l v\u00e6rdien af social aktivitet</h2><p>M\u00e5l succesen og effekten af dine sociale kampagner ved at holde dem op mod dine websitem\u00e5l, konverteringer og e-handelstransaktioner. Identificer, hvilke netv\u00e6rk der har den st\u00f8rste effekt p\u00e5 bundlinjen.</p></div></div>',
