f5a='<div class="xR"><div  class="rlb"><div class="vk"><select class="ID-complement"><option value="true"',g5a='<div class="xU"><div class="WR">Denne rapport kr\u00e6ver, at m\u00e5l og/eller sporing af e-handel er aktiveret for denne profil.</div><div class="th"><div class="fv">Hvorfor skal jeg ops\u00e6tte m\u00e5l eller sporing af e-handel?</div><div class="kG">Multikanaltragte viser dig, hvordan dine markedsf\u00f8ringskanaler arbejder sammen om at skabe salg og konverteringer. Hvis du ops\u00e6tter sporing af e-handel, kan du se dine salgstragte, og hvis du ops\u00e6tter m\u00e5l, kan du se dine konverteringstragte.</div></div><div class="th"><span class="ACTION-helplink TARGET-1191180 f">F\u00e5 flere oplysninger</span></div><div class="th"><div class="fv">Mere om m\u00e5l...</div><div class="kG">M\u00e5l er en fleksibel m\u00e5de, hvorp\u00e5 du kan m\u00e5le, i hvor h\u00f8j grad dit website eller din app opfylder dine m\u00e5l. Du kan ops\u00e6tte m\u00e5l med henblik p\u00e5 m\u00e5ling af s\u00e6rskilte handlinger s\u00e5som bes\u00f8g p\u00e5 et "Download fuldf\u00f8rt"-sk\u00e6rmbillede eller et bestemt k\u00f8bsbel\u00f8b, og du kan bruge tragte til at spore de handlinger, der f\u00f8rer frem til m\u00e5let. Hvis du indstiller en monet\u00e6r v\u00e6rdi for et m\u00e5l, kan du ogs\u00e5 se v\u00e6rdien af \u200b\u200bkonverteringer.</div></div><div class="th"><span class="ACTION-helplink TARGET-1012040 f">F\u00e5 flere oplysninger</span></div><div class="th"><div class="fv">Mere om sporing af e-handel...</div><div class="kG">Sporing af e-handel er et kodestykke, som du kan inkludere p\u00e5 dit website eller i din app med henblik p\u00e5 at indsamle transaktionsdata s\u00e5som produktsalg, k\u00f8bsbel\u00f8b og faktureringssteder og knytte til din Google Analytics-konto.</div></div><div class="th"><span class="ACTION-helplink TARGET-1037249 f">F\u00e5 flere oplysninger</span></div></div>',
